function findTheDifference(s: string, t: string): string {
  if (t.length > 1) {
    let objT = {};
    let objS = {};
    for (const x of [...t]) {
      objT[x] = (objT[x] || 0) + 1;
    }
    for (const x of [...s]) {
      objS[x] = (objS[x] || 0) + 1;
    }
    // console.log(objS);
    // console.log(Object.entries(objT));

    for (const [key, value] of Object.entries(objT)) {
      console.log(objS[key]);
      if (objS[key] !== value) return key;
    }
  }
  return t;
}

